	<br> <h3> <div> 雷尼克頓曾經是古老蘇瑞瑪可靠的守護者，但是自從那文明衰敗的帝國殞落後的數百年間，他活在瘋狂與憤怒之中。現在，他僅是一隻以怒意為食糧的野獸，不斷找尋機會殺掉自己的兄長 ─ 納瑟斯，他相信自己的瘋狂與憤怒都是他的兄長一手所造成的。</div>
